#include <fuzzer/FuzzedDataProvider.h>

#include <cstddef>
#include <cstdint>
#include "libraw/libraw.h"

extern "C" int LLVMFuzzerTestOneInput(const uint8_t* data, size_t size) {
  FuzzedDataProvider stream(data, size);

  LibRaw MyProcessor;
  int ret = MyProcessor.open_buffer(
      const_cast<uint8_t*>(data), size);
  if (ret != 0) {
    return 0;
  }
  ret = MyProcessor.unpack();
  if (ret != 0) {
    return 0;
  }
  MyProcessor.sraw_midpoint();

  return 0;
}

#include <fuzzer/FuzzedDataProvider.h>

#include <cstddef>
#include <cstdint>
#include <cstdlib>

#include "/src/libraw/libraw/libraw.h"

extern "C" int LLVMFuzzerTestOneInput(const uint8_t* data, size_t size) {
  LibRaw ImageProcessor;
  ImageProcessor.recycle();

  if (ImageProcessor.open_buffer((void *)data, size) != LIBRAW_SUCCESS) {
    return 0;
  }

  ImageProcessor.unpack();

  ImageProcessor.sraw_midpoint();
  return 0;
}
